import React from "react";
import '../Month.css';
import Week from "./Week";
import Set from "./Set";

const Month = () => {
    return <div style={{
        padding: '70px 30px 0px 280px'
    }}>
        <Set />
        <h3 style={{textAlign:"left", margin:"-20px"}}>2022.2 DDL List</h3>
        <button style={{margin:"20px 20px 20px 800px"}}>Export to Google Calendar</button>
        <Week />
        <footer className="u-align-center u-clearfix u-footer u-grey-80 u-footer" id="sec-5cf3">
            <div className="u-clearfix u-sheet u-valign-middle u-sheet-1">
                <p className="u-small-text u-text u-text-variant u-text-1">@2022 Hido Copyright.</p>
            </div>
        </footer>
    </div>;
};

export default Month;
